INSERT INTO `currency_types_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(3252, 'ruRU', 'Бронза', 'Частица времени, переплавленная в бронзовую монету. Драконы из рода Бесконечности обменивают их на декоративные награды.', 63906),
(3292, 'ruRU', 'Бесконечные знания', 'Сгусток сущности мудрости, привлеченной из другой временной линии. Бесконечные знания увеличивают количество бесконечной силы, получаемой из большинства источников. Избыточные бесконечные знания автоматически преобразуются в бронзу.', 63906),
(3008, 'ruRU', 'Камни доблести', 'Можно получить за выполнение заданий, прохождение рейдов и подземелий, матчи на полях боя и арене, победы над сияющими отголосками, а также за другие задачи для персонажей максимального уровня. Используется, чтобы улучшать снаряжение для этих персонажей.', 63906);
