(2683, 'ruRU', 'Костяной конь забвения', '|cFFFFD200Событие:|r WoW Remix: Legion', 'Хороший боевой конь верен наезднику до конца. Избавившись от оков бренной жизни, этот скакун стал знамением нищеты и смерти.', 63906),
(2682, 'ruRU', 'Костяной конь чумы', '|cFFFFD200Событие:|r WoW Remix: Legion', 'Хороший боевой конь верен наезднику до конца. Избавившись от оков бренной жизни, этот скакун стал знамением болезней и страданий.', 63906),
(2681, 'ruRU', 'Костяной конь кровопролития', '|cFFFFD200Событие:|r WoW Remix: Legion', 'Хороший боевой конь верен наезднику до конца. Избавившись от оков бренной жизни, этот скакун стал знамением вечной борьбы.', 63906),
(2679, 'ruRU', 'Костяной конь триумфа', '|cFFFFD200Событие:|r WoW Remix: Legion', 'Хороший боевой конь верен наезднику до конца. Избавившись от оков бренной жизни, этот скакун стал знамением славной победы.', 63906),
(2732, 'ruRU', 'Кобальтовый внепространственный охотник', '|cFFFFD200Промоакция:|r Burning Crusade Classic', 'Из-за потусторонней энергии, пронизывающей Дренор, эти создания научились скользить сквозь пространство. Поэтому их обычно замечают, когда становится уже слишком поздно...', 63906),
(2640, 'ruRU', 'Бомбардировщик Хмельного фестиваля', '|cFFFFD200Источник:|r Корен Худовар|n|cFFFFD200Праздник:|r Хмельной фестиваль', 'Главное, не выпить все боеприпасы.', 63906),
(2566, 'ruRU', 'Алый каскад Лана\'тель', '|cFFFFD200Внутриигровой магазин|r ', 'Пустив в ход самые изощренные чары крови, кровавая королева сотворила грозного служителя, готового нести ее в бой. Отличительные знаки королевского двора, ужасающая маска, крылья и когти – все это напоминает о его яростной хозяйке.', 63906);
