INSERT INTO `ui_splash_screen_locale` (`ID`, `locale`, `Header_lang`, `TopLeftFeatureTitle_lang`, `TopLeftFeatureDesc_lang`, `BottomLeftFeatureTitle_lang`, `BottomLeftFeatureDesc_lang`, `RightFeatureTitle_lang`, `RightFeatureDesc_lang`, `VerifiedBuild`) VALUES
(85, 'ruRU', 'Новинки в обновлении 11.2.0!', 'Экологическая сукцессия', 'Собирайте животных со всего Азерота, чтобы помочь Ве\'нари вернуть жизнь на К\'ареш.', 'Заповедник \"Аль\'дани\"', 'Защитите секретный заповедник и раскройте хранящиеся в нем древние тайны!', 'К\'ареш', 'Раскройте мрачные тайны Бездны на затерянной планете эфириалов.', 63906),
(84, 'ruRU', 'Новинки в обновлении 11.1.7!', 'Исторические кампании', 'Поговорите с хранителем истории Чо в столице, чтобы выполнить новые цепочки заданий и пережить знаменитые исторические события!', 'Боевой помощник', 'Включите эту функцию в меню настроек, чтобы упростить ротацию способностей в бою!', 'Вылазки перегружены!', 'Получите усиления от устройств титанов, спуститесь еще глубже в недра Азерота и преодолейте новые испытания!', 63906),
(80, 'ruRU', 'Новое в обновлении 11.1.5!', 'Трекер восстановления', 'Включите эту функцию в меню настроек, чтобы отслеживать восстановление способностей!', 'Скоро: Коварные Дуо', 'Сражайтесь с парами противников из прошлого Азерота и набирайте как можно больше очков!', 'Возвращение в жуткие видения', 'Вернитесь в пучину безумия, где вас ждут новые испытания и награды!', 63906),
(76, 'ruRU', 'Новое в обновлении 11.1.0!', 'РАЗГОН', 'Попробуйте новую транспортную систему Нижней Шахты на \"Стремглаве G-99\" и настраивайте его внешний вид!', 'Перестройте лагерь', 'Создавайте новые лагеря на экране выбора персонажа, разблокируйте фоны и меняйте их по своему вкусу!', 'Нижняя Шахта', 'Продолжите погоню за Ксал\'атат и сразитесь с прихвостнями Галливикса в лабиринте улиц Нижней Шахты.', 63906),
(73, 'ruRU', 'Новое в 1-м сезоне!', '1-й сезон начался', 'Зарабатывайте награды в эпохальных подземельях и новом рейтинговом режиме \"Блиц по полям боя\"!', 'Неруб\'арский дворец', 'Совершите натиск на сердце Аз-Кахета и трон королевы Ансурек.', 'Логово Зеквира', 'Покоряйте сезонный контент вылазок, чтобы открыть логово Зеквира.', 63906),
(72, 'ruRU', 'Новинки в дополнении The War Within!', 'Вылазки', 'Отправляйтесь в опасные вылазки, ищите сокровища и раскрывайте тайны.', 'Таланты героя', 'Дайте волю своей фантазии! Меняйте набор талантов так, как захотите!', 'The War Within', 'Каз Алгар ждет! Откликнитесь на зов Сияющей Песни!', 63906),
(71, 'ruRU', 'Новинки перед выходом The War Within!', 'Сияющие отголоски', 'Одолейте врагов из прошлого, воскресших в воспоминаниях Азерот. Событие начинается 31 июля!', 'Выход The War Within уже скоро', 'Выходит 26 августа (ранний доступ с 22 августа).', 'Отряды', 'У ваших персонажей теперь общий банк отряда, репутации Dragonflight и другие функции!', 63906),
(70, 'ruRU', 'Новинки в обновлении 10.2.7', 'Традиционные доспехи дренеев и троллей', 'Собирайте уникальные комплекты доспехов, погрузившись в культуру и историю этих рас.', 'Старая новая Пандария', 'Новый уникальный способ развивать героев откроется со следующей недели!', 'Вестник Тьмы', 'На Драконьих островах воцарился мир, но тьма готовит новую атаку.', 63906),
(69, 'ruRU', '10.2.7 Mists of Pandaria: Remix', 'Получайте награды для всей учетной записи', 'Собирайте бронзу для покупки транспорта, питомцев и декоративных предметов!', 'С чего начать', 'Создайте героя для путешествий во времени на экране выбора персонажа.', 'Mists of Pandaria: Remix', 'Взгляните на Mists of Pandaria с новой стороны!', 63906),
(68, 'ruRU', '', 'Зарабатывайте награды', 'Собирайте награбленное и открывайте средства передвижения, питомцев и предметы для трансмогрификации!', 'С чего начать', 'Чтобы сыграть, выйдите в меню выбора персонажа и выберите \"Пиратскую бурю\".', 'Пиратская буря', 'Сражение пиратов в грандиозном поединке за первенство!', 63906),
(64, 'ruRU', 'Новое в 4-м сезоне!', '4-й сезон Dragonflight', 'Получайте новые награды.', 'Изменена система прогресса в подземельях', 'Переработаны награды за режимы \"Героический\", \"Эпохальный\" и \"Эпохальный+\".', 'Пробужденные рейды', 'Получайте обновленные награды, покоряя рейды Dragonflight!', 63906),
(63, 'ruRU', 'Новинки в обновлении 10.2.5!', 'Азеротские Архивы', 'Раскопайте затерянное историческое наследие Драконьих островов.', 'Подземелья с соратниками', 'Проходите подземелья Dragonflight с соратниками-NPC!', 'Возвращение Гилнеаса', 'Помогите Генну Седогриву и гилнеасцам вернуть родной город.', 63906),
(61, 'ruRU', 'Новое в обновлении 10.2.0!', 'Защитники Сна', 'Остановите врагов Сна с новой фракцией, событиями и наградами.', 'Блиц по полям боя', 'Встаньте в одиночную очередь на поле боя и сразитесь в матчах 8 на 8, где нельзя расслабиться ни на секунду!', 'Изумрудный Сон', 'Войдите в Сон и защитите цветущее великое древо Амирдрассил от Фиракка и друидов пламени.', 63906),
(60, 'ruRU', 'Новое в обновлении 10.1.7!', 'Наследие ночных эльфов и Отрекшихся', 'Собирайте уникальные комплекты доспехов, погрузившись в культуру и историю этих рас.', 'Система отметок', 'Отметки помогают быстрее донести до товарищей то, чего вы хотите. Чтобы включить их, загляните в меню настроек.', 'Приливы Снов', 'Пока Амирдрассил готовится расцвести, вам предстоит сражаться с врагами, которые впитали силу снов и угрожают Драконьим островам.', 63906),
(59, 'ruRU', 'Новое в обновлении 10.1.5!', 'Специализация \"Насыщатель\"', 'Новая уникальная специализация бойцов с упором на усиление союзников!', 'Зыбкие потоки времени', 'Помогите бронзовым драконам у Грани Эпохи и в порталах времени!', 'Рассвет Бесконечности', 'Сразитесь с драконами Бесконечности в эпохальном мега-подземелье!', 63906),
(58, 'ruRU', 'Новое во 2-м сезоне!', '2-й сезон Dragonflight', 'Зарабатывайте новые награды в подземельях с эпохальными ключами и PvP-битвах', 'Обновленный режим \"Эпохальный+\"', 'Вас ждут новые свойства и обновленные подземелья в режиме \"Эпохальный+\"!', 'Аберрий, Затененное Горнило', 'В этой древней лаборатории вы продолжите погоню за Саркаретом и раскроете секреты Нелтариона.', 63906),
(57, 'ruRU', 'Новое в обновлении 10.1.0!', 'Скользящий дракозмей', 'Новый ездовой дракон промчит вас через всю пещеру Заралек!', 'Межфракционные гильдии', 'Впервые за всю историю игры игроки из Альясна и Орды смогут вступить в одну и ту же гильдию!', 'Пещера Заралек', 'История Расколотого Пламени и борьба с Воплощениями продолжится на забытых просторах подземного мира.', 63906),
(56, 'ruRU', 'Новинки в обновлении 10.0.7!', 'Традиционные доспехи людей и орков', 'Собирайте уникальные комплекты доспехов, погрузившись в культуру и историю этих рас.', 'Изменения в программе \"Пригласи друга\"', 'Приводите друзей и получайте удивительные новые награды!', 'Возвращение в Запретный край', 'Раскройте секреты драктиров, таящиеся в краю, откуда им пришлось бежать.', 63906),
(55, 'ruRU', 'Новинки в обновлении 10.0.5!', 'Неистовство бури', 'Сражайтесь с воинами стихий в их будущем, чтобы получить потрясающие награды.', 'Изменения трансмогрификации', 'Внешний вид обычных предметов и предметов низкого качества теперь можно использовать для трансмогрификации!', 'Торговая лавка открылась!', 'В Штормграде и Оргриммаре открылись новые лавки декоративных предметов.', 63906),
(50, 'ruRU', 'Новое в 1-м сезоне!', '1-й сезон PvP', 'Зарабатывайте награды в новой рейтинговой \"Соло-суматохе\".', '1-й сезон режима \"Эпохальный+\"', 'Новый список подземелий и свойство \"Рокочущий\" уже в игре.', 'Хранилище Воплощений', 'Не дайте воинам стихий освободить заточенных сородичей Рашагет.', 63906),
(49, 'ruRU', 'Новинки Dragonflight!', 'Обновление профессий', 'Заказы для ремесленников, снаряжение, специализации и многое другое!', 'Полеты на драконе', 'Взлетите в небеса Драконьих островов на транспорте с совершенно новой системой управления!', 'Драконьи острова', 'Совершите путешествие на древнюю родину драконов и помогите им вернуться к своим корням.', 63906);
